import React, { useState, useEffect } from 'react';

import { Card, CardContent, Chip, Container, Grid, Typography } from '@mui/material';

function Slots({availability}) {
console.log(availability);

  return (
    <Container maxWidth="md">
      <Grid container spacing={3}>
        {availability.map((item, index) => (
          <Grid key={index} item xs={12} sm={6} md={4}>
            <Card style={{ height: '100%' }}>
              <CardContent>
              <h6  align="left">Date: {item.dates[0]}</h6>
              <p  style={{color:"grey", fontSize:"13px"}} align="left">Upcoming Appointments</p>
          
                <div>
                  {item.startTimes.map((startTime, timeIndex) => (
                    <Chip key={timeIndex} label={startTime} variant="outlined" color="primary" className="mt-2" />
                  ))}
                </div>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default Slots;
